import tabs from '../../db.json';
import { ListSuffixes } from './NavigationSuffix.styled';

export const NavigationSuffix = () => {
  return (
    <div>
      <ListSuffixes>
        <ul>
          {tabs.suffixes.map((suffix) => {
            return <li key={suffix}>{suffix}</li>;
          })}
        </ul>
      </ListSuffixes>
    </div>
  );
};
